import React, { useEffect, useState } from 'react';

function Users() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    // Call API when component loads
    fetch('https://jsonplaceholder.typicode.com/users')
      .then(response => response.json())
      .then(data => setUsers(data))
      .catch(error => console.error('Error:', error));
  }, []);  // Empty array means run only once

  return (
    <div>
      <h2>User List</h2>
      <ul>
        {users.map(user => (
          <li key={user.id}>{user.name}</li>
        ))}
      </ul>
    </div>
  );
}

// Using axios
import axios from 'axios';

function UsersWithAxios() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    axios.get('https://jsonplaceholder.typicode.com/users')
      .then(res => setUsers(res.data))
      .catch(err => console.log(err));
  }, []);

  return (
    <div>
      <h2>User List</h2>
      <ul>
        {users.map(user => (
          <li key={user.id}>{user.email}</li>
        ))}
      </ul>
    </div>
  );
}`},{id:32,question:"32. What is the difference between fetch() and axios?",answer:"fetch() is a built-in JavaScript function for making API calls, while axios is an external library that provides a more user-friendly interface for API calls. fetch() requires manual JSON parsing and error handling, while axios handles these automatically. Key differences: fetch() is built-in (no installation needed) but requires more code, while axios needs installation but provides shorter, cleaner code with better error handling and automatic JSON parsing.",codeExample:`// fetch() example
fetch('https://api.example.com/data')
  .then(response => response.json())
  .then(data => console.log(data))
  .catch(error => console.error('Error:', error));

// axios example
